package smart_home;

public enum Porta {
	PRINCIPALE, RETRO, GARAGE;
}

package smart_home;

import java.util.HashMap;

//Tradotta dall'ASMETA smathome
public class SmartHome {
	protected boolean antifurto;
	protected int[] tapparelle;
	protected StatoLuce[] luci;
	protected HashMap<Porta, StatoPorta> porte;
	
	public SmartHome(int n_luci, int n_tapparelle) {
		antifurto = true;
		
		luci = new StatoLuce[n_luci];
		for (int i = 0; i < luci.length; i++)
			luci[i] = StatoLuce.SPENTA;
		
		tapparelle = new int[n_tapparelle];
		for (int i = 0; i < tapparelle.length; i++)
			tapparelle[i] = 100;
		
		porte = new HashMap<Porta, StatoPorta>();
		porte.put(Porta.PRINCIPALE, StatoPorta.CHIUSA);
		porte.put(Porta.RETRO, StatoPorta.CHIUSA);
		porte.put(Porta.GARAGE, StatoPorta.CHIUSA);
		
	}
	
	// Quando scatta l'allarme, chiudi porte e tapparelle e accendi le luci
	public void allarme() {
		if (antifurto) {
			for (int i = 0; i < luci.length; i++)
				luci[i] = StatoLuce.ACCESA;
			
			for (int i = 0; i < tapparelle.length; i++)
				tapparelle[i] = 100;
			
			porte.replace(Porta.PRINCIPALE, StatoPorta.CHIUSA);
			porte.replace(Porta.RETRO, StatoPorta.CHIUSA);
			porte.replace(Porta.GARAGE, StatoPorta.CHIUSA);
		}
	}
	
	// Quando attivo l'antifurto, la porta principale si chiude
	// e non posso disattivarlo se la porta principale è aperta
	public void toggleAntifurto() {
		if (antifurto) {
			if (porte.get(Porta.PRINCIPALE) == StatoPorta.APERTA)
				antifurto = false;
		}else {
			antifurto = true;
			porte.replace(Porta.PRINCIPALE, StatoPorta.CHIUSA);
		}
	}
	
	// Le azioni totali sulla casa aprono (o chiudono) tutte le porte e tapparelle
	// se chiudo tutto attivo anche l'antifurto
	public void chiudiTutto() {
		for (int i = 0; i < tapparelle.length; i++)
			tapparelle[i] = 100;
		
		porte.replace(Porta.PRINCIPALE, StatoPorta.CHIUSA);
		porte.replace(Porta.RETRO, StatoPorta.CHIUSA);
		porte.replace(Porta.GARAGE, StatoPorta.CHIUSA);
		
		antifurto = true;
	}
	public void apriTutto() {	
		for (int i = 0; i < tapparelle.length; i++)
			tapparelle[i] = 0;
		
		porte.replace(Porta.PRINCIPALE, StatoPorta.APERTA);
		porte.replace(Porta.RETRO, StatoPorta.APERTA);
		porte.replace(Porta.GARAGE, StatoPorta.APERTA);
	}
	
	// Le azioni sulle luci ne modificano solo una (accesa, spenta o soffusa)
	public void accendiLuce(int i) { luci[i] = StatoLuce.ACCESA; }
	public void spegniLuce(int i) { luci[i] = StatoLuce.SPENTA;	}
	public void luceSoffusa(int i) { luci[i] = StatoLuce.SOFFUSA; }
	
	// Le azioni sulle tapparelle le aprono o chiudono tutte
	// o impostano la percentuale di chiusura di una
	public void impostaTapparella(int i, int livello) {
		tapparelle[i] = livello;			
	}
	public void apriTapparelle() {
		for (int i = 0; i < tapparelle.length; i++)
			tapparelle[i] = 0;
	}
	public void chiudiTapparelle() {
		for (int i = 0; i < tapparelle.length; i++)
			tapparelle[i] = 100;
	}
	
		
	// Le azioni sulle porte ne modificano solo una (aperta o chiusa)
	// Quando apro la porta principale, se nessuna luce è accesa, 
	// tutte le tapparelle chiuse più del 50%, si aprono al 50%
	// La porta si può chiudere solo se l'antifurto è attivo
	public void apriPorta(Porta p) {
		porte.replace(p, StatoPorta.APERTA);
		
		boolean luceAccesa = false;
		for (int i = 0; i < luci.length; i++) {
			if (luci[i] == StatoLuce.ACCESA) {
				luceAccesa = true;
				break;
			}
		}
		if (p == Porta.PRINCIPALE && !luceAccesa) {
			for (int i = 0; i < tapparelle.length; i++)
				if (tapparelle[i] > 50) tapparelle[i] = 50;
		}
			
	}
	public void chiudiPorta(Porta p) {
		if (p == Porta.PRINCIPALE && !antifurto)
			return;
		porte.replace(p, StatoPorta.CHIUSA);
	}
	
}

package smart_home;

public enum StatoLuce {
	ACCESA, SPENTA, SOFFUSA;
}

package smart_home;

public enum StatoPorta {
	APERTA, CHIUSA;
}

package smart_home_additional_elements;

//@ code_bigint_math
public class StazioneMeteo {
	/*@ spec_public@*/ double[] tempInterna;
	/*@ spec_public@*/ int[] umiditaInterna;
	
	//@ public invariant tempInterna != null && tempInterna.length == 7;
	//@ public invariant umiditaInterna != null && umiditaInterna.length == 7;
	
	//@ requires ti != null && ti.length == 7 && ui != null && ui.length == 7;
	/*@ requires (\forall int i; 0<=i && i<7; 
					ti[i] >= 0 && ti[i] <= 40 && ui[i] > 0 && ui[i] <= 100); @*/
	//@ ensures tempInterna == ti && umiditaInterna == ui;
	public StazioneMeteo(double[] ti, int[] ui) {
		tempInterna = ti;
		umiditaInterna = ui;
	}
	
	//@ ensures (\forall int i; 0<=i && i<7; \result >= tempInterna[i]);
	//@ ensures (\exists int i; 0<=i && i<7; \result == tempInterna[i]);
	public double getMaxTemp() {
		double max = tempInterna[0];
		/*@ loop_invariant i >= 0 && i <= 7 && 
		 				(\forall int j; 0<=j && j<i; max >= tempInterna[j]) &&
		 				(\exists int j; 0<=j && j<i; max == tempInterna[j]); @*/
		for (int i = 1; i < 7; i++) {
			if(tempInterna[i]>=max) max = tempInterna[i];
		}
		return max;
	}
	
	//@ ensures \result == (\sum int i; 0<=i && i<7; umiditaInterna[i]) / 7;
	public double getUmiditaMedia() {
		double sum = 0;
		/*@ loop_invariant i >= 0 && i <= 7 && 
			sum == (\sum int j; 0<=j && j<i; umiditaInterna[j]); @*/
		for (int i = 0; i < 7; i++) {
			sum += umiditaInterna[i];
		}
		return (double)sum/7;
	}
	
	/*@ ensures ((\result == (T - (100 - RH) / 5)) <==
			(!(T < -90 || T > 60 || RH <= 0 || RH > 100))); @*/
	/*@ ensures ((\result == Double.NaN) <== 
			(T < -90 || T > 60 || RH <= 0 || RH > 100)); @*/
	public double calcoloDewPoint(double T, int RH) {
		double Tmin = -90, Tmax = 60; //Minima (e massima) temperatura rilevata sulla Terra
		if (T < Tmin || T > Tmax || RH <= 0 || RH > 100)
			return Double.NaN;
		return T - (100 - RH) / 5;
	}
	
	//@ requires UVI >= 0 && rainRate >= 0 && wind >= 0
	/*@ ensures \result <==> 
				(T <= -10 || T >= 30 || UVI > 5 
				|| (rainRate > 10 && wind > 50) 
	   			|| (T<=0 && rainRate > 0)); @*/
	public boolean allerta(double T, int UVI, double rainRate, double wind) {
		boolean allerta = false;
		if (T <= -10 || T >= 30 || UVI > 5 || (rainRate > 10 && wind > 50) 
										   || (T<=0 && rainRate > 0))
			allerta = true;
		return allerta;
	}

}

package smart_home_additional_elements;

//Tradotto dall'ASMETA vascaidro
public class VascaIdromassaggio {
	private int livello;
	
	public VascaIdromassaggio() {
		livello = 0;
	}
	
	public void riempi_completamente() {
		livello = 100;
	}
	
	public void svuota_completamente() {
		livello = 0;
	}
	
	public void riempi_25_percento() {
		if (livello + 25 > 100)
			livello = 100;
		else
			livello += 25;
	}
	
	public void svuota_25_percento() {
		if (livello - 25 < 0)
			livello = 0;
		else
			livello -= 25;
	}
	
	//Rappresenta la rule skip dell'asmeta, quando non tutti le monitoreb boolean sono false
	public void skip() {
		return;
	}
	
	public int getLivello() {
		return livello;
	}
}
